import Vue from 'vue'
import Router from 'vue-router'

import Page1 from "@/modules/admin/components/Page1.vue";
import Page2 from "@/modules/admin/components/Page2.vue";

Vue.use(Router)

let router = new Router({
    routes: [
        {
            path: '/page1',
            name: 'page1',
            component: Page1
        },
        {
            path: '/page2',
            name: 'page2',
            component: Page2
        }
    ]
})

export default router
